from typing import List
class Trie:
    def __init__(self):
        self.root = [{}, False]
    
    def insert(self, word):
        cur = self.root
        for c in word:
            if c not in cur[0]:
                cur[0][c] = [{}, False]
            cur = cur[0][c]
        cur[1] = True

    # Find str
    def find(self, word) :
        cur = self.root
        for c in word:
            if c not in cur[0]:
                return False, False
            cur = cur[0][c]
            
        return True, cur[1]

