class Solution:
    def maxRectangle(self, words: List[str]) -> List[str]:
        dict = {}
        for word in words:
            if len(word) in dict.keys():
                dict[len(word)].append(word)
            else:
                dict[len(word)] = [word]
        
        wordLens = list(dict.keys())
        wordLens.sort(reverse=True)

        def getPrefix(pf: List[str], i: int):
            ret = ''
            for word in pf:
                ret += word[i]
            return ret

        trie_dict = {}
        for i in dict.keys():
            trIns = Trie() 
            for w in dict[i]:
                trIns.insert(w)
            trie_dict[i] = trIns

        for n, m  in sorted([(i, j) for i in wordLens for j in wordLens], key=lambda p:p[0]*p[1], reverse=True):

            todo = []
            # Select the first row
            for w in dict[n]:
                isMatch = True
                for i in range(len(w)):
                    if not trie_dict[m].find(w[i])[0]:
                        isMatch = False
                        break
                if isMatch:
                    todo.append([w])

            while todo:
                # select the next row, till row = m
                prefix = todo.pop(0)
                for w in dict[n]:
                    isMatch = True
                    for i in range(len(w)):
                        if not trie_dict[m].find(getPrefix(prefix, i) + w[i])[0]:
                            isMatch = False
                            break
                    if isMatch:
                        prefix.append(w)
                        if len(prefix) == m:
                            return prefix
                        else:
                            todo.append(prefix)

